import React, {useState} from 'react';
import {Container, Form, Button, Card} from 'react-bootstrap'
import { render } from 'react-dom';

const Home = () => {
        const [status, changeStatus] = useState(false)

        if (!status) {
                return (
                        <Container className = "d-flex align-items-center justify-content-center"
                               style = {{ minHeight: "100vh" }}>
                              <div>

                            <h1 className = "text-center mb-4" >Crypto Dashboard</h1>
                            <Button href = "/login" variant="outline-primary" className = "w-50" type = "submit">Login</Button>
                            <Button href = "/signup" variant="outline-primary" className = "w-50" type = "submit">Signup</Button>
                            <div className="d-grid gap-2"></div>


                            <Button variant = "success" variant="outline-primary" className = "w-100" type = "submit">Connect to MetaMask</Button>


                        </div>
                            </Container>
                );
        }
        else {
                return( 
                        <div>Welcome</div>
                )

        }

}


export default Home;
